const link = "htpps://www.youtube.com";



ReactDOM.render(
  <>
    <h1 contentEditable="true">{`My Name is ${fname} ${lname}`}</h1>
    <img src={img1} alt="images" />
    <img src={img2} alt="images" />
    <a href={link}>
      <img src={img1} alt="images" />
    </a>

  </>,
  document.getElementById('root')
);
